import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import {TextField, Typography, Button} from '@material-ui/core'
import Grid from '@material-ui/core/Grid';
import GMaps from './Gmaps';
import SimpleMap from './Gmaps';



const Search = () => {

  const useStyles = makeStyles((theme) => ({
    root: {
      '& .MuiTextField-root': {
        margin: theme.spacing(1),
        width: 200,
    
        
      },
    },
  }));


  const getLocation = (e) =>{
    console.warn(e.target.value)
  }

  const classes = useStyles();
   return (

<Grid container>
    
     <Grid item md
     >
    <div style={{ paddingLeft:30}}>
     <TextField 
     inputProps={{style: {fontSize: 30 , fontFamily:"Courier New",color:'#E5EAF5'}}}
    InputLabelProps={{style: {fontSize:30, color:'#E5EAF5', fontFamily:"Courier New"}}}
    size='medium'
    label="Enter Location"
   onChange={getLocation}
    />
    </div>
    <div style={{paddingTop:30,  paddingLeft:30}}>
        <TextField 
      inputProps={{style: {fontSize: 30 , fontFamily:"Courier New",color:'#E5EAF5'}}}
    InputLabelProps={{style: {fontSize:30, color:'#E5EAF5', fontFamily:"Courier New"}}}
    size='medium'
    label="Enter Location"
   onChange={getLocation}
    />
    </div>
<div style={{paddingTop:30 , paddingLeft:30}}>
<TextField 
    inputProps={{style: {fontSize: 30 , fontFamily:"Courier New",color:'#E5EAF5'}}}
    InputLabelProps={{style: {fontSize:30, color:'#E5EAF5', fontFamily:"Courier New"}}}
    size='medium'
    label="Enter Location"
   onChange={getLocation}
    />

    </div>



    <div>
    
      <Grid container>

      <Grid item md="5">
        <h4 style={{marginLeft:30}}>
          Nothing to show here 
        </h4>
      </Grid>
      
      <Grid item md="2">
    
    <Button 
    style={{marginTop:10, fontSize:20, backgroundColor:'#0049B7', color:'#E5EAF5' }}
    variant="contained" >
      Search
    </Button>

    </Grid>

    </Grid>
    </div>
 
     </Grid>


     <Grid item md>
      <SimpleMap/>

     </Grid>


     
     </Grid>
   
     );
}
 
export default Search;
